import "./style.css";
import Project from "../../components/project/project";

import { projects } from "../../helpers/progectsList";

function Work() {
	return (
		<div className="work-list">
			{projects.map((project) => {
				return <Project title={project.title} />;
			})}
		</div>
	);
}

export default Work;
